import React, { useState, useEffect } from "react";
import { useParams } from "react-router-dom";
import PunkAPIService from "../services/punkapi";
import axios from "axios";

const ResourceDetail = () => {
  const { id } = useParams();
  const [resource, setResource] = useState(null);

  useEffect(() => {
    const fetchData = async () => {
      const resource = await PunkAPIService.fetchResource(id);
      setResource(resource);
      console.log (resource);
    };

    fetchData();
  }, [id]);

  const handleSave = () => {
    // Simulate a POST request with axios here
    // As there's no real endpoint, it will return an error
    axios
      .post("/fakeApiEndpoint", { id: resource.id, name: resource.name })
      .then((response) => {
        console.log(response);
      })
      .catch((error) => {
        console.error("There was an error!", error);
      });
  };

  if (!resource) {
    return <div>Loading...</div>;
  }
  return (
    <div className="flex justify-center items-center min-h-screen p-4">
      <div className="flex flex-col bg-yellow-200 shadow-xl rounded-2xl p-6">
        <figure className="w-full"><img src={resource.image_url} alt={resource.name} className="w-full h-60 object-contain"/></figure>
        <div className="card-body">
        <h2 className="card-title text-2xl">
  {resource.name} 
  <span className="italic text-gray-500">({resource.tagline})</span>
</h2>
          <p className="my-2">{resource.description}</p>
          <p><strong>ABV:</strong> {resource.abv}</p>
          <p><strong>Volume:</strong> {resource.volume.value} {resource.volume.unit}</p>
  
          <p className="font-bold text-xl mt-4">Ingredients:</p>
          <div className="pl-4">
            <p className="font-bold">Malt:</p>
            <ul>
              {resource.ingredients.malt.length ? 
                resource.ingredients.malt.map((malt, index) => (
                  <li key={index}>
                    <span className="font-semibold">{malt.name}:</span> {malt.amount.value} {malt.amount.unit}
                  </li>
                )) :
                <li>No malt ingredients available</li>
              }
            </ul>
  
            <p className="font-bold mt-2">Hops:</p>
            <ul>
              {resource.ingredients.hops.length ? 
                resource.ingredients.hops.map((hop, index) => (
                  <li key={index}>
                    <span className="font-semibold">{hop.name}:</span> {hop.amount.value} {hop.amount.unit}, 
                    <span className="font-semibold ml-2">Add:</span> {hop.add}, 
                    <span className="font-semibold ml-2">Attribute:</span> {hop.attribute}
                  </li>
                )) :
                <li>No hops ingredients available</li>
              }
            </ul>
          </div>
          
          <p className="mt-4"><strong>Brewer's Tips:</strong> {resource.brewers_tips}</p>
          <div className="card-actions justify-end">
            <button onClick={handleSave} className="btn btn-primary">Save</button>
          </div>
        </div>
      </div>
    </div>
  );
  

  

  
  
  
  
};

export default ResourceDetail;
